-- Table : google_search
CREATE TABLE google_search (
    id                INTEGER PRIMARY KEY AUTOINCREMENT,
    omited_result_url TEXT,
    next_page_url     TEXT,
    id_profile        TEXT
);


-- Table : limits
CREATE TABLE limits (
    name_limit STRING  PRIMARY KEY,
    value      INTEGER,
    activate   INTEGER
);


-- Table : linkedin_profiles
CREATE TABLE linkedin_profiles (
    id                INTEGER PRIMARY KEY AUTOINCREMENT,
    url               TEXT,
    id_social_account TEXT,
    date              TEXT,
    id_contact        INTEGER,
    source            TEXT
);


-- Table : my_contacts_linkedin
CREATE TABLE my_contacts_linkedin (
    id                INTEGER PRIMARY KEY,
    fullname          TEXT,
    fulljob           TEXT,
    fullcity          TEXT,
    id_social_account TEXT,
    keyword           TEXT,
    place             TEXT,
    was_message       INTEGER,
    was_scrapped      INTEGER
);


-- Table : pictures
CREATE TABLE pictures (
    id                INTEGER PRIMARY KEY AUTOINCREMENT,
    picture           BLOB,
    platform          STRING,
    id_social_account TEXT,
    udid_smartphone   TEXT
);


-- Table : post_code
CREATE TABLE post_code (
    id           INTEGER PRIMARY KEY AUTOINCREMENT,
    country_code TEXT,
    post_code    TEXT,
    city         TEXT,
    state        TEXT
);


-- Table : settings
CREATE TABLE settings (
    id              INTEGER PRIMARY KEY AUTOINCREMENT,
    pid             INTEGER,
    adb             TEXT,
    sdkmanager      TEXT,
    java            TEXT,
    node            TEXT,
    appium          TEXT,
    tesseract       TEXT,
    build_tools     TEXT,
    play_stop_pause INTEGER,
    license         TEXT,
    user_id         INTEGER,
    subscription_id INTEGER,
    product_id      INTEGER,
    user_email      TEXT,
    android_ok      INTEGER,
    sdkmanager_ok   INTEGER,
    java_ok         INTEGER,
    node_ok         INTEGER,
    appium_ok       INTEGER,
    tesseract_ok    INTEGER,
    build_tools_ok  INTEGER
);

