-- Table : social_accounts
CREATE TABLE social_accounts (
    id            INTEGER PRIMARY KEY AUTOINCREMENT,
    platform      TEXT,
    email         TEXT,
    username      TEXT,
    id_smartphone TEXT    REFERENCES smartphones (id) 
                          DEFAULT NULL
);


-- Table : source_target
CREATE TABLE source_target (
    id       INTEGER PRIMARY KEY,
    platform STRING,
    type     STRING,
    name     STRING,
    city     STRING,
    county   STRING,
    activity STRING
);


-- Table : sources
CREATE TABLE sources (
    id           INTEGER PRIMARY KEY AUTOINCREMENT,
    platform     STRING,
    type         STRING,
    name         STRING,
    url          TEXT,
    target_group TEXT,
    status       INTEGER
);


-- Table : tasks_user
